// client/src/App.jsx
import Header from "./components/Homepage/Header/Header.jsx"
import { Routes, Route } from "react-router-dom";
import HomePage from "./pages/Homepage.jsx";


export const App = () => {
  return (
    <div>

      <Header/>
      <Routes>
        <Route path="/" element={<Homeage/>}></Route>
      </Routes>

    </div>
  );
};

export default App;
